import React from 'react';
import logo from '../Header/logo.png';

export default class Booking extends React.Component {


	render(){
		return (
			<div className="App">
				<img src={logo} alt="movieposter"/>
	            <h5>Movie Name</h5>
				<h6>Date</h6>
				<h6>Time</h6>
				<h6>Seat No.</h6>
				<h6>Theatre Name</h6>
				<h6>Location</h6>
				<h6>Transaction Id:</h6>
      		</div>
     	);
 	}

}
